import Paper from "@material-ui/core/Paper";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

import "../../components/Form.sass";

export default function Form() {
  return (
    <section className="Form">
      <Paper>
        <AccountCircleIcon />
      </Paper>

      <style jsx>
        {`
          .MuiPaper-root {
            height: 100px;
          }
        `}
      </style>
    </section>
  );
}
